                   "#DJIMediaManager_DJIMedia_fetchMediaData_inline",
                   "Fetches this media's data from the SD card. The difference between fetching the media data and fetching the  thumbnail is that fetching the thumbnail will return a low-resolution image of the actual picture, while fetching  the media data will return all data for a video or image. The fetched data is stored in the directory  destDir, with the name fileName+.+fileExtension. DJI SDK will add the file extension according to the media type.  @param mediaFile An object of `MediaFile`. @param destDir File instance of location to save the files, which can not be null. @param fileNameWithoutExtension The fileName to store in mobile devices, without the file extension.<br> If it is null, the file name in the camera's SDCard will be used. @param callback The execution callback with the returned value(s).",
