                   "setHomeLocation",
                   2,
                   "/Components/FlightController/DJIFlightController.html",
                   "#DJIFlightController_setHomeLocation_inline",
                   "Sets the home location of the aircraft. The home location is where the aircraft returns when commanded  by `startGoHome`, when its signal is lost or when the battery is below  the lowBatteryWarning threshold. The user should be careful setting a new home point location, as  sometimes the product will not be under user control when returning home. A home location  is valid if it is within 30m of one of the following:  - initial take-off location  - aircraft's current location  - current mobile location with at least kCLLocationAccuracyNearestTenMeters accuracy level  - current remote controller's location as shown by RC GPS.  Note: If setting home point around mobile location, before calling  this method, the locationServicesEnabled must be true in CLLocationManager, the NSLocationWhenInUseUsageDescription or NSLocationAlwaysUsageDescription key needs to be specified in the  applications Info.plist and the requestWhenInUseAuthorization or requestAlwaysAuthorization method of CLLocationManager object needs to be called to get the user's permission to access location services.  @param homeLocation Home location latitude and longitude in degrees. @param callback The execution callback with the returned execution result.",
