                   "#DJIFlightController_DJIFlightControllerCurrectState_DJIFlightControllerSmartGoHomeStatus_aircraftShouldGoHome_inline",
                   "Returns whether the aircraft is requesting to go home. If the value  of `isAircraftRequestingToGoHome`  is `true` and the user does not respond after 10 seconds, the  aircraft will automatically go back to its home location. This can be cancelled at any time with the `cancelGoHome`  method (which will also clear `isAircraftRequestingToGoHome`).  It is recommended that an alert view is shown to the user when  `isAircraftRequestingToGoHome`  returns `true`. During this time, the Remote Controller will beep.  The flight controller calculates whether the aircraft should go home  based on the aircraft's altitude, distance, battery, etc. The two  main situations in which `isAircraftRequestingToGoHome` will return `true` are if the aircraft's battery is too low or if  the aircraft has flown too far away.  @return A boolean value.",
